// import "bootstrap/dist/css/bootstrap.min.css";
import "styles.scss";
import "bootstrap-overrides.css";


import { Route, BrowserRouter as Router, Switch } from "react-router-dom";

import { Container } from "react-bootstrap";
import Footer from "Shared/Footer";
import Nav from "Shared/Nav";
import NotFound from "NotFound";
import React from "react";
import styled from "styled-components";

const PageContainer = styled.div`
  margin-top: 1rem;
  min-height: 80vh;
`;

function App() {
  return (
    <Router>
      <Nav />
      <PageContainer>
        <Switch>
          {/* This is a parent route. Typically this might be for a top level 
              path (i.e. "/account"). Components can have their own child 
              routes (i.e. "/account/wallet"). Since we only have one section
              in the demo app, we are just routing all traffic to the Demo
              component. */}
          <Route exact path="/">
            <Container>
              This is the app homepage. We will eventually remove this since the
              homepage is not part of the React app.
              <br />
            </Container>
          </Route>
          <Route path="/project">
            <NotFound />
          </Route>
          <Route path="/wallet">
            <NotFound />
          </Route>
          <Route path="/account">
            <NotFound />
          </Route>
        </Switch>
      </PageContainer>
      <Footer />
    </Router>
  );
}

export default App;
